const Footer = () => {
  return (
    <footer className="bg-orange-600 text-white p-10">
      <p>
        Help us turn waste into resources. Discover how Carrot can transform the
        way you treat waste.
      </p>
      <form className="mt-4">
        <input
          type="email"
          placeholder="Your email"
          className="p-2 rounded-l"
        />
        <button className="bg-black text-white py-2 px-4 rounded-r">
          Submit
        </button>
      </form>
    </footer>
  );
};
